def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""

    words = input1.split()
    result = []

    for word in words:
        parts = word.split('-')
        transformed_word = parts[0]
        for part in parts[1:]:
            transformed_word += part.capitalize()
        result.append(transformed_word)

    return ' '.join(result)
